$(document).ready(function() {

/*===========================================================
	// Autocomplete Spot Selection
============================================================*/
	//create the data loader with the URL
	var spots_loader = new Bloodhound({
	    datumTokenizer: function (datum) {
	        return Bloodhound.tokenizers.whitespace(datum.token);
	    },
	    queryTokenizer: Bloodhound.tokenizers.whitespace,
	    remote: {
	        url: $("input.autocomplete-spot:first").attr('data-autocomplete-url')+'/FR/%QUERY',
	        
	    }
	});

	// Initialize data loader (Bloodhound suggestion engine)
	spots_loader.initialize();

	//find all input who need the autocompletion's feature
	$('input.autocomplete-spot').each(function(index){

		var input = $(this);
		var template_empty = input.attr('data-template-empty');
		var template_header = input.attr('data-template-header');
		var template_footer = input.attr('data-template-footer');
		var template_suggestion = Handlebars.compile( '<p class="tt-name"><strong>{{city}}</strong> <small>{{name}}</small></p><p class="tt-sub">{{address}}</p><p class="tt-id">{{id}}</p>');
		var trigger_length = input.attr('data-trigger-length');
		
		input.typeahead(
			{		
			minLength: trigger_length
			},
			{
			name: 'spot'+index,
			displayKey: function(datum) { return datum.city+' '+datum.name },
			source: spots_loader.ttAdapter(),
			templates: {
				empty : template_empty,
				footer : template_footer,
				header : template_header,
				suggestion: template_suggestion
				},
			}
		)
		.on('typeahead:selected',function(evt,suggestion){
			$('.autocompleted-spot_id').get(index).value = suggestion.id;
		})
		;

	});
	
});


		
$(document).ready(function() {
	

	/*===========================================================
	// Autocomplete cityName input
============================================================*/
	//create the data loader with the URL
	var sports_loader = new Bloodhound({
	    datumTokenizer: function (datum) {
	        return Bloodhound.tokenizers.whitespace(datum.token);
	    },
	    queryTokenizer: Bloodhound.tokenizers.whitespace,
	    remote: {
	        url: $(".sport-autocomplete:first").attr('data-autocomplete-url')+'/%QUERY',
	        
	    }
	});
	// Initialize data loader (Bloodhound suggestion engine)
	sports_loader.initialize();

	//find all input who need the autocompletion's feature
	$('.sport-autocomplete').each(function(index){

		var input = $(this);
		var template_empty = input.attr('data-template-empty');
		var template_header = input.attr('data-template-header');
		var template_footer = input.attr('data-template-footer');
		var template_suggestion = Handlebars.compile( '<p class="tt-name"><span class="tt-icon ws-icon ws-icon-{{ icon }}"></span> {{name}}<span class="tt-sub">{{category}}</span><p class="tt-id">{{id}} (à cacher)</p></p>');
		var trigger_length = input.attr('data-trigger-length');
		
		input.typeahead(
			{		
			minLength: trigger_length
			},
			{
			name: 'sport'+index,
			displayKey: 'name',
			source: sports_loader.ttAdapter(),
			templates: {
				empty : template_empty,
				footer : template_footer,
				header : template_header,
				suggestion: template_suggestion
				},
			}
		)
		.on('typeahead:selected',function(evt,suggestion){
			$('.sport-id-autocompleted').get(index).value = suggestion.id;
		})
		;
	})


	$("select.sportSelection").each(function(){

		$(this).select2({
			formatResult: addSportIcon,
			formatSelection: addSportIcon
		});

	});	   

});


function addSportIcon(sport){		

	if(sport.id != 'undefined'){
		var icon = $(sport.element[0].outerHTML).attr('data-icon');
		return '<span class="ws-icon ws-icon-'+icon+'"></span> <span class="sport-name">'+sport.text+'</span>';		
	}
	else 
		return sport.text;
}
$(document).ready(function() {

	/*===========================================================
		// Autocomplete City Name
	============================================================*/

	//create the data loader with the URL
	var cities_loader = new Bloodhound({
	    datumTokenizer: function (datum) {
	        return Bloodhound.tokenizers.whitespace(datum.token);
	    },
	    queryTokenizer: Bloodhound.tokenizers.whitespace,
	    remote: {
	        url: $(".city-autocomplete:first").attr('data-autocomplete-url')+'/FR/%QUERY',
	        
	    }
	});
	// Initialize data loader (Bloodhound suggestion engine)
	cities_loader.initialize();

	//find all input who need the autocompletion's feature
	$('.city-autocomplete').each(function(index){

		var input = $(this);
		var template_empty = input.attr('data-template-empty');
		var template_header = input.attr('data-template-header');
		var template_footer = input.attr('data-template-footer');
		var template_suggestion = Handlebars.compile( '<p class="tt-name">{{name}}</p><p class="tt-sub">{{state}}</p><p class="tt-id">{{id}}</p>');
		var trigger_length = input.attr('data-trigger-length');
		
		input.typeahead(
			{		
			minLength: trigger_length
			},
			{
			name: 'city'+index,
			displayKey: 'name',
			source: cities_loader.ttAdapter(),
			templates: {
				empty : template_empty,
				footer : template_footer,
				header : template_header,
				suggestion: template_suggestion
				},
			}
		)
		.on('typeahead:selected',function(evt,suggestion){
			$('.city-id-autocompleted').get(index).value = suggestion.id;

			if($(this).hasClass('auto-adjust-width')){
				console.log(suggestion.name.length);
				$(this).attr('size',suggestion.name.length+2);
			}
		})
		;
	})


	/*===========================================================
	// Display States Select Box with Select2
	============================================================*/
	if($('.geo-select').length != 0){

		$('.geo-select-country').select2({ formatResult: countryFlag, formatSelection: countryFlag});				
		$('.geo-select:not(.geo-select-country,.hide)').select2();
	}

	
	/*===========================================================
	// Ajax States Select Box on Change
	============================================================*/	
	$('.geo-select-ajax').change(function(){

		var parent = $(this);
		var url = parent.attr('data-ajax-url');
		var level = parent.attr('data-geo-level');
		var value = parent.val();
		parent.addClass('geo-loading');
		//parent.parent('.control-group').next('.control-group .controls .geo-select').empty().hide();

		$.ajax({
			type: 'GET',
			url: url,
			data: { level: level, value: value },
			dataType: 'json',
			success: function(data){

				parent.removeClass('geo-loading');
				$('.geo-select-'+data.level).first().empty().append(data.options).select2().show();
							
			}
		})
	});
});




function countryFlag(state) {

	return "<img class='flag flag-"+state.id.toLowerCase()+"' /> "+state.text;
}
